import React, { Component } from 'react';
import TodoListTemplate from './Component/TodoListTemplate.js';
import Form from './Component/Form.js';

class App extends Component {
  render() {
    return (
      <TodoListTemplate from={<Form/>}>
        템플릿 완성
      </TodoListTemplate>
    );
  }
}

export default App;
